import React from "react";

const home = () => {
  return (
    <div className='dummy'>
      <h1 className='dummyText'>Geostructure Cologne</h1>
      <h4 className='dummyText'>
        Geodateninfrastruktur des geographischen Institutes der Universität zu
        Köln
      </h4>
      <img src='./img/geo.png'></img>
    </div>
  );
};

export default home;
